import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Header from "./Header";
import HomeConts1 from "./components/fullPage/HomeConts1";
import HomeConts2 from "./components/fullPage/HomeConts2";


const App = () => {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="/" exact element={<HomeConts1/>} />
        <Route path="/about" element={<HomeConts2/>} /> {/* Use HomeConts2 */}
        <Route path="/projects" element={<HomeConts3/>} /> {/* Use HomeConts3 */}
        <Route path="/contact" element={<HomeConts2/>} /> {/* Use HomeConts4 */}
      </Switch>
    </Router>
  );
};

export default App;
